import React from "react";
import {
  Button
} from "@material-ui/core";
import './Main.css'
class Main extends React.Component {
  render() {
    return ( <
      div className = "Movie-names" >
      <
      img src = {
        this.props.movie.imgUrl
      }
      width = "250"
      height = "150"
      alt = "" / >
      <
      h3 > {
        this.props.movie.name
      } < /h3> <
      p > Date: {
        this.props.movie.date
      } < /p> <
      Button color = "success" >
      <
      a href = {
        this.props.movie.Trailer
      }
      target = "_blank"
      rel = "noopener noreferrer" >
      Watch Trailer <
      /a> <
      /Button> <
      /div>
    );
  }
}
export default Main;
